import React from "react";
import "./SectionFirst.css";
import {Logo} from "../../../../public/logo";

function SectionFirst() {
  return (
    <div className="sectionFirst">
      <div className="slide1">
        <div className="col1">
          <img src={Logo} alt="" />
          <p>
            Lorem, ipsum dolor sit amet consectetur adipisicing elit. Molestias
            hic illum esse veritatis vel ipsum itaque sed quod dolorem!
            Perspiciatis cupiditate, officia architecto laborum soluta nemo unde
            quis dicta minus saepe earum ex quaerat amet voluptas aliquam
            molestias dolor? Beatae tempore quod quae aperiam nobis debitis,
            explicabo animi officiis dignissimos! Dolore, repellendus velit amet
            explicabo veniam reiciendis consectetur voluptate suscipit. Magnam
            impedit sit quaerat? Eaque quas eum repellendus sequi, deserunt
            expedita sint? Exercitationem, fugit expedita. Quidem sed, iusto
            voluptatum iure magnam id, eius numquam commodi eos animi natus
            dolore quod ipsam earum? Iusto numquam totam dolores facilis alias
            cum quae.
          </p>
        </div>
        <div className="col2"></div>
      </div>
    </div>
  );
}

export default SectionFirst;
